import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Bar } from 'react-chartjs-2';
import './MoreData.css';

const MoreData = () => {
    const [years, setYears] = useState([]);
    const [firstYear, setFirstYear] = useState('');
    const [secondYear, setSecondYear] = useState('');
    const [data, setData] = useState(null);

    useEffect(() => {
        const fetchUniqueYears = async() => {
            try {
                const response = await axios.get('http://localhost:1000/api/suggest-years');
                console.log('Fetched years:', response.data.years);
                setYears(response.data.years || []);
            } catch (error) {
                console.error('Error fetching years:', error);
            }
        };

        fetchUniqueYears();
    }, []);

    const generateYearRange = (startYear) => {
        const start = parseInt(startYear, 10);
        return Array.from({ length: 5 }, (v, i) => start + i);
    };

    const handleCompare = async() => {
        if (firstYear && secondYear) {
            const firstYearRange = generateYearRange(firstYear);
            const secondYearRange = generateYearRange(secondYear);

            try {
                const response = await axios.post('http://localhost:1000/api/compare-years', {
                    firstYearRange,
                    secondYearRange,
                });

                const { statuses, firstYearData, secondYearData } = response.data;

                // Prepare the data for the grouped bar chart
                const chartData = {
                    labels: statuses, // X-axis labels (Application Status)
                    datasets: [{
                            label: `Data for ${firstYearRange.join(', ')}`,
                            data: firstYearData, // Counts for the first year
                            backgroundColor: 'rgba(75, 192, 192, 0.6)',
                        },
                        {
                            label: `Data for ${secondYearRange.join(', ')}`,
                            data: secondYearData, // Counts for the second year
                            backgroundColor: 'rgba(153, 102, 255, 0.6)',
                        },
                    ],
                };

                setData(chartData); // Update the chart with the fetched data
            } catch (error) {
                console.error('Error comparing year ranges:', error);
            }
        } else {
            console.log('Please select both years.');
        }
    };

    // Filter years to exclude the selected years in the other dropdown
    const getFilteredYears = (selectedYear) => {
        return years.filter(year =>
            (selectedYear && !generateYearRange(selectedYear).includes(parseInt(year))) || !selectedYear
        );
    };

    return ( <
        div className = "more-data-page" >
        <
        h2 > Compare Placement Statistics < /h2> <
        div className = "selectors" >
        <
        div className = "dropdowns" >
        <
        select value = { firstYear }
        onChange = {
            (e) => setFirstYear(e.target.value) } >
        <
        option value = "" > Select Year
        for First Range < /option> {
            getFilteredYears(secondYear).length > 0 ? (
                getFilteredYears(secondYear).map((year) => ( <
                    option key = { year }
                    value = { year } > { year } < /option>
                ))
            ) : ( <
                option value = "" > No Years Available < /option>
            )
        } <
        /select>

        <
        select value = { secondYear }
        onChange = {
            (e) => setSecondYear(e.target.value) } >
        <
        option value = "" > Select Year
        for Second Range < /option> {
            getFilteredYears(firstYear).length > 0 ? (
                getFilteredYears(firstYear).map((year) => ( <
                    option key = { year }
                    value = { year } > { year } < /option>
                ))
            ) : ( <
                option value = "" > No Years Available < /option>
            )
        } <
        /select> <
        /div>

        <
        div className = "button-container" >
        <
        button onClick = { handleCompare }
        className = "submit-btn" > Submit < /button> <
        /div> <
        /div>

        {
            data && ( <
                div className = "results" >
                <
                Bar data = { data }
                options = {
                    {
                        responsive: true,
                        scales: {
                            y: {
                                beginAtZero: true,
                                title: {
                                    display: true,
                                    text: 'Counts',
                                },
                            },
                            x: {
                                title: {
                                    display: true,
                                    text: 'Application Status',
                                },
                            },
                        },
                        plugins: {
                            legend: {
                                position: 'top',
                            },
                            tooltip: {
                                callbacks: {
                                    label: (context) => `${context.dataset.label}: ${context.raw}`,
                                },
                            },
                        },
                    }
                }
                /> <
                /div>
            )
        } <
        /div>
    );
};

export default MoreData;
